    # Mock the fetch_data method
    with patch.object(service, 'fetch_data', return_value=[1, 2, 3, 4, 5]):
        result = service.process_data('http://example.com')
        assert result == 5

def timer_decorator(func):
    import time
    def wrapper(*args, **kwargs):
        start = time.time()
        result = func(*args, **kwargs)
        end = time.time()
        print(f"{func.__name__} took {end - start:.2f} seconds")
        return result
    return wrapper

